  true,\n\t\"url\": null,\n\t\"notes\": \"<p>About 25 percent of the hospitalizations
  for dual eligible beneficiaries in 2005 were potentially avoidable. Medicare and
  Medicaid spending for those potentially avoidable hospitalizations (PAHs) was almost
  6 billion dollars, or about 20 percent of total spending on inpatient care for the
  dual eligibles. We estimate that those costs increased to 7-8 billion dollars in
  2011.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
